import React from "react";

function NavHeader() {
    return (
        <nav class="nav">
          <ul class="ul-nav">
            <li class="item"><a href="/">Sign In</a></li>
            <li class="item"><a href="/">Sign Up</a></li>
            <li class="item"><a href="/">Lists</a></li>
          </ul>
        </nav>
    )
}

export default NavHeader;
